import React from "react";
export class EmployeeRender extends React.Component{
    render(){
        let t = new Date(this.props.ticket.submitted);
        return(
            <>
            <tbody></tbody>
            <tr>
                <td>{this.props.ticket.reimbursementID}</td>
                <td>{this.props.ticket.description}</td>
                <td>{this.props.ticket.reimbursementAmount}</td>
                <td>{this.props.ticket.reimbursementType}</td>
                <td>{this.props.ticket.reimbursementStatus}</td>
                <td>{t.toLocaleDateString()}</td>
                <td>{this.props.ticket.userRole}</td>
            </tr>
            </>
        )
    }
}
